def use_re():
    dates_pattern_1 = r'(?<=\s)(?:(?:(?:\d{2}[/.-]){2}\d{4})|(?:\d{4}(?:[/.-]\d{2}){2}))'
    dates_patter_2 = r'(?:January|February|March|April|May|June|July|August|September|OctoberNovember|December)\s\d{2},\s\d{4}'

    print(re.findall(dates_pattern_1, text))
    print(re.findall(dates_patter_2, text))

    email_pattern = r'[a-z][a-z0-9._+]*@[a-z0-9]+[a-z0-9-]*(?:\.[a-z\-]+)+'

    print(re.findall(email_pattern, text, re.I))

    phone_numbers_pattern = r'(?:(?:\+\d-)?\(?:?\d{3}\)?[- .]\d{3}[- .]?\d{4})|(?:\+\d\d (?:\d{5}|\d{2}) [\d ]+)'
    print(re.findall(phone_numbers_pattern, text))

    urls_pattern = r'\b(?:(?:https?)|(?:ftps?))?(:\/\/)?(?:[a-z-]+)(?:\.[a-z]+)+(?:/[a-z\d.]*)*(?:\?(?:[a-z\d]*=[a-z\d]*))*(?:(?:&[a-z\d]*=[a-z\d]*))*(?:#[a-z]+)*(?!@)\b'


